svg.script:
    function linkify() {
      var fileMap = {'aa-boston':
                     'http://dig.csail.mit.edu/2005/ajar/ajaw/tab.html?uri=http://www.w3.org/2006/07dc-bos/aa-bos-options.rdf',
		     'nwalsh':
		     'http://dig.csail.mit.edu/2005/ajar/ajaw/tab.html?uri=http://norman.walsh.name/knows/who#norman-walsh',
		     'tabdata':
		     'http://dig.csail.mit.edu/2005/ajar/ajaw/tab.html?uri=http://dig.csail.mit.edu/2005/ajar/ajaw/data#Tabulator',
		     'tagmobile':
		     'http://dig.csail.mit.edu/2005/ajar/ajaw/tab.html?uri=http://www.w3.org/2004/lambda/Documents/2006/06/12/all.rdf',
		     'w3data':
		     'http://dig.csail.mit.edu/2005/ajar/ajaw/tab.html?uri=http://www.w3.org/2000/04/mem-news/public-groups.rdf'
		     }
      var txtNodes = document.getElementsByTagName("text")
      for (var x=txtNodes.length-1; x >= 0; x--) {
        if (txtNodes[x].className.baseVal=="cat-label") {
          txtNodes[x].onclick=function () {
            window.open(fileMap[this.firstChild.firstChild.textContent])
	  }
        }
	if (txtNodes[x].className.baseVal=="data-value") {
	  txtNodes[x].style.display = "none"
	}
      }
      for (var x=5; x > 0; x--) {
        var jval = document.getElementById("d"+x+"j")
	var jbar = document.getElementById("b"+x+"j")
	var jerr = document.getElementById("e"+x+"j")
	var rval = document.getElementById("d"+x+"r")
	var rbar = document.getElementById("b"+x+"r")
	var rerr = document.getElementById("e"+x+"r")
	var over = function (v,e) {
	  return function () {
	    v.style.display="block"
	    e.style.display="block"
	  }
	}
	var out = function (v,e) {
	  return function () {
	    v.style.display="none"
	    e.style.display="none"
	  }
	}
        jbar.onmouseover=over(jval,jerr)
	jbar.onmouseout=out(jval,jerr)
	rbar.onmouseover=over(rval,rerr)
	rbar.onmouseout=out(rval,rerr)
	out(jval,jerr)()
	out(rval,rerr)()
      }
    }
